import './App.css';
import React from 'react';
import { Button, TextField, Icon, Container } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

function RowNameDate() {
  return (
    <div className="rowDate">
      <label>Name</label>
      <TextField className="inputName" id="outlined-basic" label="Name" variant="outlined" />

      <label>Date</label>
      <TextField
        className="inputDate"
        id="date"
        label="Register Date"
        type="date"
        defaultValue="2017-05-24"
        InputLabelProps={{
          shrink: true,
        }}
      />
    </div>
  );
}

function SendBtn() {
  return (
    <div className="sendBtn">
      <Button
        variant="contained"
        color="primary"
        endIcon={<Icon>send</Icon>}
      >
        Send
    </Button>
    </div>
  );
}

function RowContext() {
  return (
    <div className="rowContent">
      <label>Context</label>
      <TextField
        className="inputContext"
        id="outlined-basic"
        label="Context"
        variant="outlined"
        fullWidth="true"
        multiline
      />
    </div>
  );
}

function App() {

  return (
    <Container className="inputContainer">
      <form className="InputForm">
        <RowNameDate />
        <RowContext />
      </form>
      <SendBtn />
    </Container>
  );
}

export default App;
